import {Routes, Route, useNavigate} from 'react-router-dom';
import CountryMap from '../maps/CountryMap';
import WorldMap from '../maps/WorldMap';

export default function DropDown2() {
  const navigate = useNavigate();

  const navigateToCountryMap = () => {
    // üëáÔ∏è navigate to /contacts
    navigate('/country-map');
  };

  const navigateToWorldMap = () => {
    // üëáÔ∏è navigate to /
    navigate('/world-map');
  };

  return (
    <div>
      <div>
        <button onClick={navigateToWorldMap}>CountryMap</button>
        <hr />
        <button onClick={navigateToCountryMap}>WorldMap</button>

        <Routes>
          <Route path="/country-map" element={<CountryMap />} />
          <Route path="/world-map" element={<Home />} />
        </Routes>
      </div>
    </div>
  );
}
